import React from 'react';
import heroVideo from '../assets/Images/video-list-0.jpg';

export default function Hero() {
    return (
        <>
            <div className="hero">
                <div className="hero__video">
                    <img src={heroVideo} alt="" />
                </div>
            </div>
        </>
    );
}
